function App() {

  const eventSubmit = (event) => {

    PeticionPut().then((res => {
      console.log("Resultttt: " + res)
    }));
    event.preventDefault();
  }

  return (

    <div className="App">
      <h2>PREDECIR</h2>
      <form onSubmit={eventSubmit}>
        <label>
          AÃ±o:
          <input type="text" name="name" />
        </label>
        <label>
